

</head>
<body>

<main>
    <!-- Page Header Start -->
    <div class="container-fluid page-header mb-5 wow fadeIn" data-wow-delay="0.1s">
        <div class="container">
            <h1 class="display-3 mb-3 animated slideInDown">Registro de Cacao</h1>
            <nav aria-label="breadcrumb animated slideInDown">
                <ol class="breadcrumb mb-0">
                    <li class="breadcrumb-item"><a class="text-body" href="#">Home</a></li>
                    <li class="breadcrumb-item"><a class="text-body" href="#">Pages</a></li>
                    <li class="breadcrumb-item text-dark active" aria-current="page">Registro</li>
                </ol>
            </nav>
        </div>
    </div>



    <div class="container-xxl py-5">
        <div class="container">
            <div class="row g-0 gx-5 align-items-end">
                <div class="col-lg-6">
                    <div class="section-header text-start mb-5 wow fadeInUp" data-wow-delay="0.1s" style="max-width: 500px;">
                        <h1 class="display-5 mb-3">Producción de Cacao en Boyacá</h1>
                        <p>Conoce más sobre la cosecha de cacao de alta calidad en el municipio de Boyacá.</p>
                    </div>
                </div>
            </div>
    
            <!-- Filtros del Registro de Cacao -->
            <div class="filter-section container-xl py-5">
                <div class="row mb-4">
                    <div class="col-md-8">
                        <h2 class="d-flex justify-content-end text-white">Filtros del Registro de Cacao</h2>
                    </div>
                    <div class="col-md-4 text-right">
                        <button class="btn btn-custom mr-2">
                            <i class="fas fa-arrow-left"></i> Volver
                        </button>
                        <button class="btn btn-custom">
                            <i class="fas fa-home"></i> Inicio
                        </button>
                    </div>
                </div>
    
                <div class="row">
                    <div class="col-md-8">
                        <span class="d-flex justify-content-end text-white">Filtros</span>
                    </div>
                    <div class="col-md-15">
                        <div class="form-group">
                            <label class="text-white">Tipo de cacao:</label>
                            <div class="form-check form-check-inline">
                                <input type="radio" name="cacaoType" class="form-check-input" value="criollo">
                                <label class="form-check-label text-white">Criollo</label>
                            </div>
                            <div class="form-check form-check-inline">
                                <input type="radio" name="cacaoType" class="form-check-input" value="forastero">
                                <label class="form-check-label text-white">Forastero</label>
                            </div>
                            <div class="form-check form-check-inline">
                                <input type="radio" name="cacaoType" class="form-check-input" value="trinitario">
                                <label class="form-check-label text-white">Trinitario</label>
                            </div>
                        </div>
    
                        <div class="row">
                            <div class="col-md-6">
                                <div class="form-group">
                                    <label class="text-white">Año de producción:</label>
                                    <select class="form-control">
                                        <option value="2023">2023</option>
                                        <option value="2022">2022</option>
                                    </select>
                                </div>
    
                                <div class="form-group">
                                    <label class="text-white">Región:</label>
                                    <select class="form-control">
                                        <option value="boyaca">Boyacá</option>
                                    </select>
                                </div>
    
                                <div class="form-group">
                                    <label class="text-white">Cantidad cosechada (kg):</label>
                                    <input type="number" class="form-control" placeholder="Ingrese cantidad">
                                </div>
                            </div>
    
                            <div class="col-md-6">
                                <div class="form-group">
                                    <label class="text-white">Calidad:</label>
                                    <select class="form-control">
                                        <option value="">Seleccione calidad</option>
                                        <option value="alta">Alta</option>
                                        <option value="media">Media</option>
                                        <option value="baja">Baja</option>
                                    </select>
                                </div>
    
                                <div class="form-group">
                                    <label class="text-white">Año de comparación:</label>
                                    <select class="form-control">
                                        <option value="">Seleccione año</option>
                                        <option value="2022">2022</option>
                                    </select>
                                </div>
    
                                <div class="form-group">
                                    <label class="text-white">Estado de la cosecha:</label>
                                    <select class="form-control">
                                        <option value="">Seleccione estado</option>
                                        <option value="fresca">Fresca</option>
                                        <option value="seca">Seca</option>
                                    </select>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
                <div class="text-center">
                    <button class="btn reset-button">Reiniciar filtros</button>
            </div>
        </div>
    </div>
    

